        "description": "<p>FabHotel Cabana is located in the affluent colony of Greater Kailash, and is one of the premium properties for travelers looking for an affordable yet luxurious stay. It offers:<\/p><ul>\r\n<li>\tA delightful stay for business travelers and families close in a safe and posh locality<\/li>\r\n<li>\tSpacious air-conditioned rooms with modern interiors and all basic amenities such as TV, attached bathrooms, laptop table, and free Wi-Fi  <\/li>\r\n<li>\tEasy access to popular shopping destinations in Delhi such as M-Block and N-Block Greater Kailash-I markets, and Lajpat Nagar markets<\/li>\r\n<\/ul><strong>Where We Are Located<\/strong><ul>\r\n<li>\tFabHotel Cabana is located in the affluent R Block of Greater Kailash Part-I<\/li>\r\n<li>\tIn close proximity to Kailash Colony metro station (1.5 km) and provides easy access to prominent business centers in Nehru Place (1.5 km), Okhla Industrial Area (5.8 km), and Central Delhi (Connaught Place)<\/li>\r\n<li>\tThe closest railway station is Nizamuddin Railway Station (7.9 km) and the Indira Gandhi International Airport is 15.9 km or 45 minutes by cab<\/li>\r\n<li>\tLocated within a 2-3 km radius of prominent shopping markets in Greater Kailash-I, Lajpat Nagar, and South Extension<\/li>\r\n<li>\tIdeally for travelers seeking medical treatment from AIIMS (6 km) or Max Super Speciality Hospital in Saket (6 km)<\/li>\r\n\r\n<\/ul><strong>Our Rooms and Amenities<\/strong><ul>\r\n<li>\tFabHotel Cabana is a beautiful modern-designed hotel and provides 27 stylish rooms spread over four floors to give you a relaxed and tranquil stay<\/li>\r\n<li>\tThe rooms provide suite-sized beds with duvets and spring mattresses, and are well-equipped with facilities like LCD TV, bedside lamps, sitting area, work desks, lockers, tea\/coffee makers, mini-bars, balcony (selected rooms) and attached bathroom with 24-hour running hot and cold water<\/li>\r\n<li>\tAs a premium boutique hotel, FabHotel Cabana provides laundry and a conference room facility for business travelers, along with basic amenities such as parking, room service, 24-hour operational a front desk, pick and drop service (chargeable), and 24-hour power back-up<\/li>\r\n<\/ul><strong>Where to Eat<\/strong><ul>\r\n<li>\tEnjoy sumptuous vegetarian and non-vegetarian meals-in-bed by ordering room service<\/li>\r\n<li>\tGuests can also head out to Greater Kailash M-Block, N-Block, and Kailash Colony markets to enjoy an assortment of cuisines at popular restaurants such as Gastronomica (Indo-Continental), The Big Chill Caf\u00e9 (Italian), Juggernaut (South Indian), Zaffran (Mughlai-Indian), and Music and Mountains (European)  <\/li>\r\n\r\n<\/ul><strong>What You\u2019ll Love<\/strong><ul>\r\n<li>\tShoppers\u2019 Paradise: FabHotel Cabana is easily accessible from Greater Kailash M-block Market and South Extension markets (4.4 km) for budgeted and branded shopping \u2013 you can find an assortment of clothing, jewelry, and accessories Guests can also head out to Lajpat Nagar market for budgeted shopping and deals<\/li>\r\n<li>\tSightseeing: FabHotel Cabana is close to some of the city\u2019s major tourist attractions such as Lotus Temple (2.1 km), Iskcon Temple (1.8 km), Humayun\u2019s Tomb (6.4 km), and the Delhi Zoo (7.3 km)<\/li>\r\n<li>\tLeisure: If you are a movie buff, take a short cab ride to M Cinemas in East of Kailash (1.2 km) or Satyam Cineplexes, Nehru Place (1.8 km) to catch the latest Bollywood movies in comfortable reclining seats<\/li>\r\n<\/ul>\r\n",
