export const parsedData = () => {
    var dummyData = []
    let categoryWiseImages = data.data.categoryWiseImages
    for (category in categoryWiseImages){
        let list = categoryWiseImages[category].list
        for(x in list) {
            let object  = {
                title : category,
                image : categoryWiseImages[category].baseUrl + list[x]
            }
            dummyData.push(object)
        }
    }
    return dummyData;
}